[{"location":"#Exercise7.jl-Documentation","page":"Exercise7.jl Documentation","title":"Exercise7.jl Documentation","text":"","category":"section"},{"location":"#Compartmental-Models","page":"Exercise7.jl Documentation","title":"Compartmental Models","text":"","category":"section"},{"location":"","page":"Exercise7.jl Documentation","title":"Exercise7.jl Documentation","text":"Exercise7.AbstractCompartmentalModel","category":"page"},{"location":"#Exercise7.AbstractCompartmentalModel","page":"Exercise7.jl Documentation","title":"Exercise7.AbstractCompartmentalModel","text":"AbstractCompartmentalModel{T<:AbstractFloat}\n\nSupertype of all compartmental models defined in this package.\n\n\n\n\n\n","category":"type"},{"location":"#SIR-Models","page":"Exercise7.jl Documentation","title":"SIR Models","text":"","category":"section"},{"location":"","page":"Exercise7.jl Documentation","title":"Exercise7.jl Documentation","text":"Exercise7.AbstractSIRModel\nExercise7.SIR\nExercise7.SIR(du, u, p, t)\nExercise7.SIR()\n\nExercise7.SIRDecayingImmunity\nExercise7.SIRDecayingImmunity(α)\nExercise7.SIRDecayingImmunity(du, u, p, t)","category":"page"},{"location":"#Exercise7.AbstractSIRModel","page":"Exercise7.jl Documentation","title":"Exercise7.AbstractSIRModel","text":"AbstractSIRModel{T} <: AbstractCompartmentalModel{T}\n\nSupertype of all SIR models.\n\n\n\n\n\n","category":"type"},{"location":"#Exercise7.SIR","page":"Exercise7.jl Documentation","title":"Exercise7.SIR","text":"SIR{T} <: AbstractSIRModel{T}\n\nStandard SIR model with contact rate beta, recovery rate gamma, and no demography:\n\nbeginaligned\nfracdSdt  = -beta I S 8pt\nfracdIdt  = beta I S - gamma I 8pt\nfracdRdt  = gamma I \nendaligned\n\nObjects of this type are callable with the signature (du, u, p, t) which performs an in-place update of the derivatives du of the system.\n\n\n\n\n\n","category":"type"},{"location":"#Exercise7.SIR-NTuple{4, Any}","page":"Exercise7.jl Documentation","title":"Exercise7.SIR","text":"(::SIR)(du, u, p, t) -> nothing\n\nUpdate the derivates du given a model of type SIR.\n\n\n\n\n\n","category":"method"},{"location":"#Exercise7.SIR-Tuple{}","page":"Exercise7.jl Documentation","title":"Exercise7.SIR","text":"SIR() -> SIR\n\nReturn an SIR model with default parameters beta = 035 and  gamma = 0035.\n\n\n\n\n\n","category":"method"},{"location":"#Exercise7.SIRDecayingImmunity","page":"Exercise7.jl Documentation","title":"Exercise7.SIRDecayingImmunity","text":"SIRDecayingImmunity{T} <: AbstractSIRModel{T}\n\nSIR model with contact rate beta, recovery rate gamma, infection  immunity decay rate alpha, and no demography:\n\nbeginaligned\nfracdSdt  = -beta I S + alpha R 8pt\nfracdIdt  = beta I S - gamma I 8pt\nfracdRdt  = gamma I - alpha R \nendaligned\n\nObjects of this type are callable with the signature (du, u, p, t) which performs an in-place update of the derivatives du of the system.\n\n\n\n\n\n","category":"type"},{"location":"#Exercise7.SIRDecayingImmunity-Tuple{Any}","page":"Exercise7.jl Documentation","title":"Exercise7.SIRDecayingImmunity","text":"SIRDecayingImmunity(α) -> SIRDecayingImmunity\n\nReturn an SIRDecayingImmunity model with immunity decay rate alpha and default parameters beta = 035 and gamma = 0035.\n\n\n\n\n\n","category":"method"},{"location":"#Exercise7.SIRDecayingImmunity-NTuple{4, Any}","page":"Exercise7.jl Documentation","title":"Exercise7.SIRDecayingImmunity","text":"(::SIRDecayingImmunity)(du, u, p, t) -> nothing\n\nUpdate the derivates du given a model of type SIRDecayingImmunity.\n\n\n\n\n\n","category":"method"},{"location":"#SIRV-Models","page":"Exercise7.jl Documentation","title":"SIRV Models","text":"","category":"section"},{"location":"","page":"Exercise7.jl Documentation","title":"Exercise7.jl Documentation","text":"Exercise7.AbstractSIRVModel\n\nExercise7.SIRV\nExercise7.SIRV(du, u, p, t)\nExercise7.SIRV(ν)\n\nExercise7.SIRVSeasonalContact\nExercise7.SIRVSeasonalContact(β₁, ν)\nExercise7.SIRVSeasonalContact(du, u, p, t)\n\nExercise7.SIRVDecayingImmunity\nExercise7.SIRVDecayingImmunity(ν, α, μ)\nExercise7.SIRVDecayingImmunity(du, u, p, t)\n\nExercise7.SIRVSeasonalContactDecayingImmunity\nExercise7.SIRVSeasonalContactDecayingImmunity(β₁, ν, α, μ)","category":"page"},{"location":"#Exercise7.AbstractSIRVModel","page":"Exercise7.jl Documentation","title":"Exercise7.AbstractSIRVModel","text":"AbstractSIRVModel{T} <: AbstractCompartmentalModel{T}\n\nSupertype of all SIRV models.\n\n\n\n\n\n","category":"type"},{"location":"#Exercise7.SIRV","page":"Exercise7.jl Documentation","title":"Exercise7.SIRV","text":"SIRV{T} <: AbstractSIRVModel{T}\n\nSIRV model with contact rate beta, recovery rate gamma, vaccination rate nu, and no demography:\n\nbeginaligned\nfracdSdt  = -beta I S -nu S8pt\nfracdIdt  = beta I S - gamma I 8pt\nfracdRdt  = gamma I 8pt\nfracdVdt  = nu S \nendaligned\n\nObjects of this type are callable with the signature (du, u, p, t) which performs an in-place update of the derivatives du of the system.\n\n\n\n\n\n","category":"type"},{"location":"#Exercise7.SIRV-NTuple{4, Any}","page":"Exercise7.jl Documentation","title":"Exercise7.SIRV","text":"(::SIRV)(du, u, p, t) -> nothing\n\nUpdate the derivates du given a model of type SIRV.\n\n\n\n\n\n","category":"method"},{"location":"#Exercise7.SIRV-Tuple{Any}","page":"Exercise7.jl Documentation","title":"Exercise7.SIRV","text":"SIRV(ν) -> SIRV\n\nReturn an SIRV model with vaccination rate nu and default parameters beta = 035 and  gamma = 0035.\n\n\n\n\n\n","category":"method"},{"location":"#Exercise7.SIRVSeasonalContact","page":"Exercise7.jl Documentation","title":"Exercise7.SIRVSeasonalContact","text":"SIRVSeasonalContact{T} <: AbstractSIRVModel{T}\n\nSIRV model with seasonal contact rate beta(t), recovery rate gamma,  vaccination rate nu, and no demography.\n\nThe contact rate beta(t) is given by  beta(t) = beta_0(1 + beta_1 cos(2pi t  365)), where beta_0 is the mean contact rate and 0 leq beta_1 leq 1 controls the degree of  seasonality. \n\nThe full equations of motion are:\n\nbeginaligned\nfracdSdt  = -beta(t) I S -nu S8pt\nfracdIdt  = beta(t) I S - gamma I 8pt\nfracdRdt  = gamma I 8pt\nfracdVdt  = nu S \nendaligned\n\nObjects of this type are callable with the signature (du, u, p, t) which performs an in-place update of the derivatives du of the system.\n\n\n\n\n\n","category":"type"},{"location":"#Exercise7.SIRVSeasonalContact-Tuple{Any, Any}","page":"Exercise7.jl Documentation","title":"Exercise7.SIRVSeasonalContact","text":"SIRVSeasonalContact(β₁, ν) -> SIRVSeasonalContact\n\nReturn an SIRVSeasonalContact model with seasonality parameter beta_1,  vaccination rate nu, and default parameters beta_0 = 035 and  gamma = 0035.\n\n\n\n\n\n","category":"method"},{"location":"#Exercise7.SIRVSeasonalContact-NTuple{4, Any}","page":"Exercise7.jl Documentation","title":"Exercise7.SIRVSeasonalContact","text":"(::SIRVSeasonalContact)(du, u, p, t) -> nothing\n\nUpdate the derivates du given a model of type SIRVSeasonalContact.\n\n\n\n\n\n","category":"method"},{"location":"#Exercise7.SIRVDecayingImmunity","page":"Exercise7.jl Documentation","title":"Exercise7.SIRVDecayingImmunity","text":"SIRVDecayingImmunity{T} <: SIRVDecayingImmunity{T}\n\nSIRV model with contact rate beta, recovery rate gamma, vaccination  rate nu, infection immunity decay rate alpha, vaccination immunity  decay rate mu, and no demography:\n\nbeginaligned\nfracdSdt  = -beta I S -nu S + alpha R + mu V8pt\nfracdIdt  = beta I S - gamma I 8pt\nfracdRdt  = gamma I - alpha R8pt\nfracdVdt  = nu S - mu V\nendaligned\n\nObjects of this type are callable with the signature (du, u, p, t) which performs an in-place update of the derivatives du of the system.\n\n\n\n\n\n","category":"type"},{"location":"#Exercise7.SIRVDecayingImmunity-Tuple{Any, Any, Any}","page":"Exercise7.jl Documentation","title":"Exercise7.SIRVDecayingImmunity","text":"SIRVDecayingImmunity(ν, α, μ) -> SIRVDecayingImmunity\n\nReturn an SIRVDecayingImmunity model with vaccination rate nu, infection  immunity decay rate alpha, vaccination immunity decay rate mu, and  default parameters beta_0 = 035 and gamma = 0035.\n\n\n\n\n\n","category":"method"},{"location":"#Exercise7.SIRVDecayingImmunity-NTuple{4, Any}","page":"Exercise7.jl Documentation","title":"Exercise7.SIRVDecayingImmunity","text":"(::SIRVDecayingImmunity)(du, u, p, t) -> nothing\n\nUpdate the derivates du given a model of type SIRVDecayingImmunity.\n\n\n\n\n\n","category":"method"},{"location":"#Exercise7.SIRVSeasonalContactDecayingImmunity","page":"Exercise7.jl Documentation","title":"Exercise7.SIRVSeasonalContactDecayingImmunity","text":"SIRVSeasonalContactDecayingImmunity{T} <: SIRVSeasonalContactDecayingImmunity{T}\n\nSIRV model with seasonal contact rate beta(t), recovery rate gamma,  vaccination rate nu, infection immunity decay rate alpha, vaccination immunity decay rate mu, and no demography.\n\nThe contact rate beta(t) is given by  beta(t) = beta_0(1 + beta_1 cos(2pi t  365)), where beta_0 is the mean contact rate and 0 leq beta_1 leq 1 controls the degree of  seasonality. \n\nThe full equations of motion are:\n\nbeginaligned\nfracdSdt  = -beta(t) I S -nu S + alpha R + mu V8pt\nfracdIdt  = beta(t) I S - gamma I 8pt\nfracdRdt  = gamma I - alpha R8pt\nfracdVdt  = nu S - alpha V\nendaligned\n\nObjects of this type are callable with the signature (du, u, p, t) which performs an in-place update of the derivatives du of the system.\n\n\n\n\n\n","category":"type"},{"location":"#Exercise7.SIRVSeasonalContactDecayingImmunity-NTuple{4, Any}","page":"Exercise7.jl Documentation","title":"Exercise7.SIRVSeasonalContactDecayingImmunity","text":"(::SIRVSeasonalContactDecayingImmunity)(du, u, p, t) -> nothing\n\nUpdate the derivates du given a model of type SIRVSeasonalContactDecayingImmunity.\n\n\n\n\n\n","category":"method"}]
